  ngOnInit() {
    this.GetDetalleLineas(500);
    this.loadMap();

  }
  async GetDetalleLineas(dato){
    await this.mostrar_loading();
    this.mantenimiento_servicio.get_detalle_lineas(this.start,this.limite,"").subscribe(data=>{
      
      this.lista_detalle_linea=JSON.parse(JSON.stringify(data)).datos;
      console.log("lista detalle linea ",this.lista_detalle_linea);
      this.ocultar_loading();
     
    },error=>{

      this.ocultar_loading();
      console.log("ver errores ",JSON.stringify(error));

    }) 
  }
  async mostrar_loading() {
    this.loading = await this.loadingController.create({
      cssClass: 'my-custom-class',
      message: 'Cargando ...',
    });
    await this.loading.present();
  }
  ocultar_loading(){
    try {
      this.loading.dismiss();
    } catch (error) {
      console.log("Error al ocultar loading ",error);
    }
  }

  abrir_selector_subestacion(selector) {

    

    selector.open().then((alert)=>{
      this.seleccionar_todo_subestacion = this.document.getElementById("seleccionar_todo_subestacion");
      this.checkBoxes = this.document.getElementsByClassName("alert-checkbox");
      this.listener = this.renderer.listen(this.seleccionar_todo_subestacion, 'click', () => {
          if (this.seleccionar_todo_subestacion.checked) {

            console.log("llega subestacion ",this.checkBoxes);

            for (let checkbox of this.checkBoxes) {
              if (checkbox.getAttribute("aria-checked")==="false") {
                (checkbox as HTMLButtonElement).click();
              };
            };
          } else {
            for (let checkbox of this.checkBoxes) {
              if (checkbox.getAttribute("aria-checked")==="true") {
                (checkbox as HTMLButtonElement).click();
              };
            };
          }
      });
      alert.onWillDismiss().then(()=>{
        this.listener();
      });
    })
  }
