  abrir_filtros_detalle_linea(dato:number){

    this.lista_detalle_linea_seleccionado=[];

    



    if(dato==0){
      this.dato_linea="General";
      this.calcular_linea(500);
      this.calcular_linea(230);
      this.calcular_linea(132);
      this.calcular_linea(115);
      this.calcular_linea(69);
      this.sumar_todo_linea();
    }else{
      this.dato_linea=String(dato)+" kV";
      this.calcular_linea(dato);
    }

    if(this.lista_detalle_linea_seleccionado.length!=0){
      this.isModalDetalleLinea=true;
    }


  
   
  }
  calcular_linea(dato:number){

    let sum_capacidad_mva=0;
    let sum_capacidad_mw=0;
    let sum_componente="";
    let sum_id_detalle_componente=0;
    let sum_longitud=0;
    let sum_reactancia=0;
    let sum_resistencia=0;
    let sum_susceptancia;
    let sum_tension ="";
    let bandera=0;


    for (let index = 0; index < this.lista_detalle_linea.length; index++) {
      if(this.lista_detalle_linea[index].tension == dato  ){
       
        bandera=1;
        sum_capacidad_mva=sum_capacidad_mva+Number(this.lista_detalle_linea[index].capacidad_mva);
        sum_capacidad_mw=sum_capacidad_mw+Number(this.lista_detalle_linea[index].capacidad_mw);
        sum_componente= "Total";
        sum_id_detalle_componente = 0;
        sum_longitud= sum_longitud+Number(this.lista_detalle_linea[index].longitud);
        sum_reactancia= sum_reactancia+Number(this.lista_detalle_linea[index].reactancia);
        sum_resistencia= sum_resistencia+Number(this.lista_detalle_linea[index].resistencia);
        sum_susceptancia = sum_susceptancia+Number(this.lista_detalle_linea[index].susceptancia);
        // sum_tension = Number(this.lista_detalle_linea[index].tension);
        this.lista_detalle_linea_seleccionado.push(this.lista_detalle_linea[index]);
      }
    }
    if(this.lista_detalle_linea_seleccionado.length==0){
      this.alerta("No existen datos en "+dato);

    }else{

      if(bandera == 1){
        this.lista_detalle_linea_seleccionado.push(
          {capacidad_mva:sum_capacidad_mva.toFixed(2),
            capacidad_mw:sum_capacidad_mw.toFixed(2),
            componente:sum_componente,
            // id_detalle_componente:0,
            longitud:sum_longitud.toFixed(2),
            // reactancia:sum_reactancia.toFixed(2),
            resistencia:sum_resistencia.toFixed(2),
            // susceptancia:sum_susceptancia.toFixed(2),
            tension:sum_tension
        });
      }

    }

  }
  sumar_todo_linea(){

    let sum_capacidad_mva=0;
    let sum_capacidad_mw=0;
    let sum_componente="Total general";
    let sum_id_detalle_componente=0;
    let sum_longitud=0;
    let sum_reactancia=0;
    let sum_resistencia=0;
    let sum_susceptancia;
    let sum_tension ="";

    for (let index = 0; index < this.lista_detalle_linea_seleccionado.length; index++) {
      if(this.lista_detalle_linea_seleccionado[index].componente == 'Total' ){
        sum_capacidad_mva=sum_capacidad_mva+Number(this.lista_detalle_linea_seleccionado[index].capacidad_mva);
        sum_capacidad_mw=sum_capacidad_mw+Number(this.lista_detalle_linea_seleccionado[index].capacidad_mw);
        sum_longitud= sum_longitud+Number(this.lista_detalle_linea_seleccionado[index].longitud);
        sum_reactancia= sum_reactancia+Number(this.lista_detalle_linea_seleccionado[index].reactancia);
        sum_resistencia= sum_resistencia+Number(this.lista_detalle_linea_seleccionado[index].resistencia);
        sum_susceptancia = sum_susceptancia+Number(this.lista_detalle_linea_seleccionado[index].susceptancia);
        // sum_tension = Number(this.lista_detalle_linea[index].tension);
      }
      
    }
    this.lista_detalle_linea_seleccionado.push(
      {capacidad_mva:sum_capacidad_mva.toFixed(2),
        capacidad_mw:sum_capacidad_mw.toFixed(2),
        componente:sum_componente,
        // id_detalle_componente:0,
        longitud:sum_longitud.toFixed(2),
        // reactancia:sum_reactancia.toFixed(2),
        resistencia:sum_resistencia.toFixed(2),
        // susceptancia:sum_susceptancia.toFixed(2),
        tension:sum_tension
      });
  }
